def resource_path(relative_path):
    """ Get absolute path to resource, works for dev and for PyInstaller """
    if getattr(sys, 'frozen', False):
        base_path = sys._MEIPASS
    else:
        base_path = os.getcwd()
    return os.path.join(base_path, relative_path)

def analyse():
        global img
        devlabel.configure(text="Developped \n"
                            "by \n"
                            "BOUZID YASSINE\n 2020")

        # Load Yolo


        net = cv2.dnn.readNet("yolov3_training_last.weights", "yolov3_testing.cfg")

        # Images path
        images_path = glob.glob("*.jpg")
        k= len(images_path)

        layer_names = net.getLayerNames()
        output_layers = [layer_names[i[0] - 1] for i in net.getUnconnectedOutLayers()]

        # Loading image
        img = cv2.imread("img.jpg")
        height, width, channels = img.shape

        # Detecting objects
        blob = cv2.dnn.blobFromImage(img, 0.00392, (416, 416), (0, 0, 0), True, crop=True)
        net.setInput(blob)
        outs = net.forward(output_layers)

        # Showing informations on the screen
        class_ids = []
        confidences = []
        boxes = []
        for out in outs:
            for detection in out:
                scores = detection[5:]
                class_id = np.argmax(scores)
                confidence = scores[class_id]
                if confidence > 0.3:
                    # Object detected
                    print(class_id)
                    center_x = int(detection[0] * width)
                    center_y = int(detection[1] * height)
                    w = int(detection[2] * width)
                    h = int(detection[3] * height)

                    # Rectangle coordinates
                    x = int(center_x - w / 2)
                    y = int(center_y - h / 2)

                    boxes.append([x, y, w, h])
                    confidences.append(float("{:.2f}".format(confidence)))
                    class_ids.append(class_id)
                    font = cv2.FONT_HERSHEY_SIMPLEX
        lst = []
        for i in range(len(boxes)):

                    x, y, w, h = boxes[i]
                    defct_dimention = (math.sqrt(w ** 2 + h ** 2)) * .1
                    print("defect dimention=" + str(defct_dimention))
                    lst.append("{:.2f}".format(defct_dimention))
                    label = "Defect " + lst[i] + "mm"
                    cv2.rectangle(img, (x, y), (x + w, y + h), (255,0,0), 2)
                    cv2.putText(img, label, (x-24, y-20 ), font, 1, (0, 255, 0), 2)

        devlabel.configure( text="defect dimention=\n"+ str(lst)+ " mm\n"+ str(confidences) + " %")
        cv2.imwrite("imgcv.jpg", img)
        img1 = Image.open('imgcv.jpg')
        myimage = ImageTk.PhotoImage(img1)
        my_label = Label(frm, image=myimage)
        my_label.image = myimage
        my_label.grid(row=0, column=1, padx=70)
        key = cv2.waitKey(0)
        cv2.destroyAllWindows()


